    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <span className="font-weight-bold">EsaLink</span>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="https://www.google.com">Tma connection</Nav.Link>
        </Nav>
        {/* <OverlayTrigger
          trigger={["hover", "focus"]} // Include 'focus' trigger
          placement="bottom"
          overlay={expertisePopover}
        >
          <Nav.Link>Expertise</Nav.Link>
        </OverlayTrigger> */}


<OverlayTrigger
      trigger={['hover', 'focus']}
      placement="bottom"
      overlay={popoverHoverFocus}
    >
                <Nav.Link>Expertise</Nav.Link>

    </OverlayTrigger>

    <OverlayTrigger
      trigger={['hover', 'focus']}
      placement="bottom"
      overlay={popoverHoverFocus}
